import styled from 'styled-components'
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'

const SinglePostContainer = styled.div`
  flex: 9;
`

const SinglePostWrapper = styled.div`
  padding: 30px;
  border-radius: 10px;
`

const SinglePostImage = styled.img`
  width: 100%;
  border-radius: 10px;
  object-fit: cover;
`

const SinglePostTitle = styled.h1`
`


const SinglePost = () => {
  return (
    <>
      <SinglePostContainer>
        <SinglePostWrapper>
          <SinglePostImage src={require('../../../content/img/blog-cover.jpg').default}/>
          <SinglePostTitle>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Reprehenderit, asperiores.

          </SinglePostTitle>
        </SinglePostWrapper>
      </SinglePostContainer>
    </>
  )
}
// <i class="fa-solid fa-pen-to-square"></i>
export default SinglePost
